import React from "react";
import {
  View,
  ScrollView,
  TouchableOpacity,
  Text,
  Dimensions,
} from "react-native";
import Svg, { SvgXml } from "react-native-svg";
const { width, height } = Dimensions.get("window");
import { ActivityIndicator, FAB } from "react-native-paper";
import { AntDesign } from "@expo/vector-icons";
import { useIsFocused } from "@react-navigation/native";
import { useSelector } from "react-redux";
import {
  getAppointment,
  getUserAppointment,
  getVendorAppointment,
} from "../../../Class/appointment";
import { Color } from "../../../assets/colors";
import { changeTime, timeConverter } from "../../../action";
import Avatar from "../../../components/Avatar";
import { Cart } from "./UserAppointmentList";
const status = [
  {
    title: "Incomplete",
    color: "#1A1A1A",
  },
  {
    title: "Completed",
    color: "#1A1A1A",
  },
  {
    title: "Cancelled",
    color: "#1A1A1A",
  },
  {
    title: "Pending",
    color: "#1A1A1A",
  },
  {
    title: "Approved",
    color: "#1A1A1A",
  },
];

export default function UserRequestAppointment({ navigation, route }) {
  const [Active, setActive] = React.useState("Sent");
  const user = useSelector((state) => state.user);

  const [Loader, setLoader] = React.useState(false);
  const [Data, setData] = React.useState([]);
  const isDark = useSelector((state) => state.isDark);
  const colors = new Color(isDark);
  const backgroundColor = colors.getBackgroundColor();
  const vendor = useSelector((state) => state.vendor);
  const [Upcoming, setUpcoming] = React.useState();
  const [Previous, setPrevious] = React.useState();
  const isFocused = useIsFocused();

  React.useLayoutEffect(() => {
    //console.log("okk")
    if (user && Active && Active != "Request") {
      setLoader(true);
      getUserAppointment(user.token, Active, user.user.id)
        .then((res) => {
          setLoader(false);
          //console.log(res.data.appointments)
          let arr = [];
          res.data.appointments.map((doc, i) => {
            arr.push(doc);
          });
          setData(arr);
        })
        .catch((err) => {
          setLoader(false);
          console.warn(err.response.data.msg);
        });
    }
  }, [isFocused + Active]);

  //console.log(data.service.serviceCenterName)
  if (Loader) {
    return (
      <View
        style={{
          flex: 1,
          justifyContent: "center",
          alignItems: "center",
        }}>
        <ActivityIndicator size={"small"} color={backgroundColor} />
      </View>
    );
  }
  return (
    <ScrollView showsVerticalScrollIndicator={false} style={{ flex: 1 }}>
      <View
        style={{
          flexDirection: "row",
          paddingHorizontal: 10,
          paddingVertical: 10,
        }}>
        <Chip
          style={{ width: 70 }}
          onPress={() => {
            setActive("Sent");
          }}
          title={"Sent"}
          active={Active == "Sent" ? true : false}
        />
        <View
          style={{
            width: 10,
          }}
        />
        <Chip
          onPress={() => {
            setActive("Receive");
          }}
          title={"Receive"}
          active={Active == "Receive" ? true : false}
        />
      </View>
      <View style={{ height: 8 }} />
      {Data.length == 0 ? <NoAppointment /> : null}

      {Data.map((doc, i) => (
        <Cart
          key={i}
          onPress={() => {
            //console.log(doc)
            navigation.navigate("UserAppointmentDetails", {
              data: doc,
            });
          }}
          status={
            status.filter((s) => s.title.toUpperCase().match(doc.status))[0]
          }
          title={doc.title}
          date={`${doc.date} ${changeTime(doc.startTime)}`}
          name={doc.service.providerInfo.name}
          image={doc.service.profilePhoto}
          username={doc.service.providerInfo.name
            .replace(" ", "")
            .toLowerCase()}
          position={doc.service.providerInfo.position}
        />
      ))}
      <View style={{ height: 8 }} />
    </ScrollView>
  );
}


const Chip = ({ title, active, onPress, style }) => {
  return (
    <TouchableOpacity
      onPress={onPress}
      style={[
        {
          padding: 8,
          backgroundColor: active ? "#DA1E37" : "transparent",
          borderRadius: 20,
          paddingHorizontal: 15,
          borderWidth: active ? 0 : 1,
          borderColor: "#E2E2E2",
          justifyContent: "center",
          alignItems: "center",
        },
        style,
      ]}>
      <Text
        style={{
          color: active ? "white" : "black",
        }}>
        {title}
      </Text>
    </TouchableOpacity>
  );
};
const NoAppointment = () => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        height: height - 250,
      }}>
      <SvgXml xml={vectorImage} height="200" width="200" />
      <Text
        style={{
          fontSize: 16,
          fontFamily: "Poppins-Medium",
          marginTop: 10,
        }}>
        No Appointment Found
      </Text>
    </View>
  );
};
const vectorImage = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="197" height="197" viewBox="0 0 197 197">
<defs>
  <pattern id="pattern" preserveAspectRatio="xMidYMid slice" width="100%" height="100%" viewBox="0 0 761 640">
    <image width="761" height="640" xlink:href="data:image/jpeg;base64,"/>
  </pattern>
</defs>
<g id="vv" stroke="#f1efef" stroke-width="1" fill="url(#pattern)">
  <circle cx="98.5" cy="98.5" r="98.5" stroke="none"/>
  <circle cx="98.5" cy="98.5" r="98" fill="none"/>
</g>
</svg>
`;
